import React from 'react'
import dynamic from 'next/dynamic'
const PDFViewer = dynamic(() => import('pdf-viewer-reactjs'), {ssr:false})

const Resume = () => {
    return (
        <PDFViewer
            document={{
                url: 'https://arxiv.org/pdf/quant-ph/0410100.pdf',
            }}
        />
    )
}

export default Resume
